            mode: 'cors',
            headers: {
              'Access-Control-Allow-Origin':'*'
            }
          })
        .then(response => response.json())
            // 4. Setting *dogImage* to the image url that we received from the response above
        .then(data => console.log(data.message))
    }, [])
